import React from "react";
import "./index.css";


function App() {
    return (
        <body>

            <header>
            <div class="logo">B-Rate</div>
            <nav>
                <ul>
                <li><a href="App.js">Home</a></li>
                <li><a href="public/index.html">Food Trucks</a></li>
                <li><a href="HTML/dininghall.html">Dining Halls</a></li>
                <li><a href="HTML/contact.html">Contact</a></li>
                <li><a href="HTML/about.html">About</a></li>
                </ul>
            </nav>
            <div class="toggle-icon">&#9776;</div>
            </header>

            <h1>Welcome to Bruin Rate</h1>

        </body>
    );
  }

  export default App;
